import React, { Component } from 'react';

class Subscribe extends Component {
    render() {
        return (
            <section id="subscribe" className="subscribe-area ptb-100">
                <div className="container">
                    <div className="subscribe-content">
                        <h2>Subscribe our Newsletter</h2>
                        <p>Quis ipsum suspendisse ultrices gravida. Risus commodo viverra maecenas accumsan lacus vel facilisis.</p>

                        <form className="newsletter-form" data-toggle="validator">
                            <div className="row align-items-center">
                                <div className="col-lg-8 col-md-8">
                                    <input type="email" className="form-control" placeholder="Email address" name="EMAIL" required={true} />
                                </div>

                                <div className="col-lg-4 col-md-4">
                                    <button type="submit">Subscribe</button>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>

                <div className="rocket"><img src="/images/rocket.png" alt="rocket" /></div>
                <div className="map"><img src="/images/map.png" alt="map" /></div>
            </section>
        );
    }
}

export default Subscribe;
